int conv(int a){
    // printf("Converting %d\n",a);
    if(a==139)return 92;
    if(a>121&&a<=131) return a-121;
    if(a>133&&a<=143) return a-133+10;
    if(a>12183&&a<=12193) return a-12183+20;
    if(a>32787&&a<=32797) return a-32787+30;
    if(a>0x100000)return a-0x100000;
    return a;
}

long long brute(long long n){
    unsigned long long ret=1;
    for(long long i=1; i<=n; i++){
        ret*=i;
        ret%=4294967291ll;
        if(i==150000*(n/150000)){
            long long g=(long long)ret;
            int a = g&0xffff;
            int b = ((g>>16)&0xffff);
            printf("::%d %d\n",conv(b),conv(a));
            printf("::%llu\n",ret);
        }
    }
    return (long long)ret;
}
